pt;font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:"Times New Roman";color:#222222">RE:<b> <u>APPLICATION\r\nFOR INTERNAL AUDIT ASSISTANT POSITION<o:p></o:p></u></b></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; background: white;"><b><u><span style="font-size:10.0pt;font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:"Times New Roman";color:#222222"><br>\r\n<br>\r\n</span></u></b><span style="font-size:10.0pt;font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:"Times New Roman";color:#222222">I hereby wish to apply\r\nfor the above mentioned post in your organization. I am Kenya citizen aged 26\r\nyears and Certified Public Accountant Graduate from Kenya collage of\r\naccountancy university (KCAU) which I attained in December 2012.</span><span style="font-size:9.5pt;font-family:"Arial","sans-serif";mso-fareast-font-family:\r\n"Times New Roman";color:#222222"><o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; background: white;"><span style="font-size:10.0pt;font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:"Times New Roman";color:#222222"> </span><span style="font-size:9.5pt;font-family:"Arial","sans-serif";mso-fareast-font-family:\r\n"Times New Roman";color:#222222"><o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; background: white;"><span style="font-size:10.0pt;font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:"Times New Roman";color:#222222">Currently I am working\r\nwith Villa surgical and equipments limited as an Accountant from January 2013\r\nto date. I have learnt a lot through this opportunity as I interact with the\r\ncustomers that we deal with plus the sales representative whose deals with our\r\nclients directly. My salary expectation is a range of ksh.28,000 and above.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; background: white;"><span style="font-size:9.5pt;font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:"Times New Roman";color:#222222"> </span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; background: white;"><span style="font-size:10.0pt;font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:"Times New Roman";color:#222222">Am seeking a\r\nchallenging role that will allow me to grow in building\r\noutstanding service in your organization. </span><span style="font-size:9.5pt;font-family:"Arial","sans-serif";mso-fareast-font-family:\r\n"Times New Roman";color:#222222"><o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 12pt; background: white;"><span style="font-size:10.0pt;font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:"Times New Roman";color:#222222"><br>\r\nGiven a chance, I will devote myself to work hard and smart, making sure that\r\nmy tasks are well completed and duly and I will serve your organization\r\nwith utmost faith and diligence toward achieving the company goals and meeting\r\nyour clients demands in this dynamic market.</span><span style="font-size:9.5pt;\r\nfont-family:"Arial","sans-serif";mso-fareast-font-family:"Times New Roman";\r\ncolor:#222222"><o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; background: white;"><span style="font-size:10.0pt;font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:"Times New Roman";color:#222222">I am looking forward\r\nto a favorable considerable consideration.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; background: white;"><span style="font-size:9.5pt;font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:"Times New Roman";color:#222222"> </span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; background: white;"><span style="font-size:10.0pt;font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:"Times New Roman";color:#222222"> </span><span style="font-size:9.5pt;font-family:"Arial","sans-serif";