uot;Times New Roman&quot;,&quot;serif&quot;">THE\r\nSECRETARY,</span></b></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n150%"><b style="mso-bidi-font-weight:normal"><span style="font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">COUNTY\r\nPSB,</span></b></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n150%"><b style="mso-bidi-font-weight:normal"><span style="font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">P.O.BOX\r\n36-30600, ISIOLO</span></b></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n150%"><span style="font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n150%"><span style="font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">Dear\r\nSir/Madam,</span><span style="font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;"><span style="mso-spacerun:yes">&nbsp;</span></span>\r\n\r\n</p><p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n150%"><b style="mso-bidi-font-weight:normal"><u><span style="font-size:12.0pt;\r\nline-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">REF: <span style="mso-bidi-font-weight:bold">COHESION OFFICER </span></span></u></b></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify"><span style="font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">I\r\nhereby submit my application for the above post in your organization as\r\nadvertised. I’m industrious, passionate about my work, dynamic, self- motivated\r\nand able to motivate others, smart and result-oriented team player with\r\nexcellent communication and interpersonal skills. Too, I have the drive to rise\r\nto the expectations placed on this position for I have the ability and the\r\nrelevant experience to work in competitive environments, coupled with\r\nwillingness and readiness to learn new ideas. </span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify"><span style="font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify"><span style="font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">I\r\ncleared my Bachelors Degree in Business Information Technology (BBIT) and awaiting\r\ngraduation and now am undertaking a Microsoft Certified Solutions Expert (MCSE)\r\ncertification course. Also, I hold a Higher Diploma in Information Technology having\r\nsuccessfully undergone all stages as stipulated in the course curriculum. In\r\naddition, I hold a certificate in Customer Care, a Kenya Certificate of\r\nSecondary Examination (K.C.S.E.), a Kenya Certificate of Primary Examination, a\r\nCertificate of Service and a recommendation letter from my former employers. </span></p>\r\n\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:4.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">In the job market, I have\r\nmore than eight years experience gained in my various engagements and therefore\r\nI hold a strong conviction that given this opportunity, I will tirelessly put\r\nthis experience into good use to enhance the institution’s productivity and\r\ngrowth as well as my career development.</span><span style="font-size:12.0pt;\r\nline-height:115%"></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:150%"><span style="font-size:12.0pt;line-height:150%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;">Attached alongside this cover letter is\r\na copy of my curriculum vitae. I look forward to hearing from you hoping that\r\nmy application will merit your consideration.</span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n150%"><span style="font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n150%"><span style="font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">Thank\r\nyou in advance.<br>\r\nYours faithfully, <br>\r\n</span></p><p class="MsoNormal" style="margin-bottom:0in;margin-bottom:.0001pt;line-height:\r\n150%"><span style="font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;">Joshua Maiso. <br style="mso-special-character:line-break" clear="all">\r\n</span></p>\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w