41	564	clerk	<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]-->\r\n\r\n<p class="SenderAddressCxSpFirst"><span style="font-family:&quot;Times New Roman&quot;,serif">Didymus\r\nIbrahim Nyamweya,</span></p>\r\n\r\n\r\n <p class="SenderAddressCxSpMiddle"><span style="font-family:&quot;Times New Roman&quot;,serif">P.O.\r\n Box 1431-20100,</span></p>\r\n\r\n\r\n<p class="SenderAddressCxSpMiddle"><span style="font-family:&quot;Times New Roman&quot;,serif">NAKURU,</span></p>\r\n\r\n<p class="SenderAddressCxSpMiddle"><span style="font-family:&quot;Times New Roman&quot;,serif">KENYA.</span></p>\r\n\r\n<p class="SenderAddressCxSpMiddle"><span style="font-family:&quot;Times New Roman&quot;,serif">&nbsp;</span></p>\r\n\r\n<p class="SenderAddressCxSpMiddle"><span style="font-family:&quot;Times New Roman&quot;,serif">29<sup>TH</sup>\r\nJune 2016.</span></p>\r\n\r\n<p class="SenderAddressCxSpLast"><span style="font-family:&quot;Times New Roman&quot;,serif">&nbsp;</span></p>\r\n\r\n<p class="RecipientAddressCxSpFirst"><span style="font-family:&quot;Times New Roman&quot;,serif">&nbsp;</span></p>\r\n\r\n<p class="RecipientAddressCxSpMiddle"><span style="font-family:&quot;Times New Roman&quot;,serif">P.O.\r\nBox </span></p>\r\n\r\n<p class="RecipientAddressCxSpMiddle"><span style="font-family:&quot;Times New Roman&quot;,serif">NAIROBI</span></p>\r\n\r\n<p class="RecipientAddressCxSpLast"><span style="font-family:&quot;Times New Roman&quot;,serif">KENYA.</span></p>\r\n\r\n<p class="MsoSalutation"><span style="font-family:&quot;Times New Roman&quot;,serif">Dear\r\nsir/madam,</span></p>\r\n\r\n<p class="MsoNormal"><span style="font-family:&quot;Times New Roman&quot;,serif">Due to the\r\nannouncement on the internet on data clerk opportunities at your organization,\r\nI hereby apply for the clerk position in your organization.</span></p>\r\n\r\n<p class="MsoNormal"><span style="font-family:&quot;Times New Roman&quot;,serif">I am a\r\ngraduate with a Bachelor’s degree in Actuarial science from Kisii University. I\r\nhave demonstrated strong academic performance maintaining a good performance.\r\nThe course I have completed has given me a solid foundation in the tools,\r\nprocesses and methodologies involved in the successful analysis and management\r\nof various port-folio investment strategies. I have proven ability to learn\r\nchallenging concept quickly and developed competence in diverse areas\r\nincluding:<span style="mso-spacerun:yes">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span><span style="mso-spacerun:yes">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></p>\r\n\r\n<p class="MsoListParagraphCxSpFirst" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><span style="font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-family:&quot;Times New Roman&quot;,serif">Industry\r\nresearch and information sourcing</span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><span style="font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-family:&quot;Times New Roman&quot;,serif">Good\r\ncommunication skills</span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><span style="font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-family:&quot;Times New Roman&quot;,serif">Leadership\r\nskills</span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><span style="font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-family:&quot;Times New Roman&quot;,serif">Quality\r\nAssurance and Hazard analysis and Critical control points </span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><span style="font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-family:&quot;Times New Roman&quot;,serif">Risk\r\nmitigation</span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><span style="font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-family:&quot;Times New Roman&quot;,serif">Financial\r\nmodelling and asset valuation</span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><span style="font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-family:&quot;Times New Roman&quot;,serif">Portfolio\r\nand Asset Management</span></p>\r\n\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><span style="font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-family:&quot;Times New Roman&quot;,serif">Insurance\r\nplan and mutual funds</span></p>\r\n\r\n<p class="MsoListParagraphCxSpLast" style="text-indent:-.25in;mso-list:l0 level1 lfo1"><span style="font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol"><span style="mso-list:Ignore">·<span style="font:7.0pt &quot;Times New Roman&quot;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style="font-family:&quot;Times New Roman&quot;,serif">Quantitative\r\nanalysis</span></p>\r\n\r\n<p class="MsoNormal"><span style="font-family:&quot;Times New Roman&quot;,serif">In\r\naddition to my analytical strengths I bring to the table advanced computer\r\nskills in computer packages, data analysis, Interpretation and Report writing.</span></p>\r\n\r\n<p class="MsoNormal"><span style="font-family:&quot;Times New Roman&quot;,serif">Since\r\nstarting college I have worked part-time as a financial adviser at CIC\r\nInsurance group. I have earned a reputation for consistently exceeding the\r\ninstitutions and customer expectations. I yearn to gain more experience in the\r\ncorporate world and I am impressed by your organization’s innovation and\r\nsuccess, and I would very much like to be part of such a winning organization.</span></p>\r\n\r\n<p class="MsoNormal"><span style="font-family:&quot;Times New Roman&quot;,serif">If you\r\nagree that I could make valuable addition to your team, please feel free to\r\ncall me at +254715488431 or email me at </span><a href="mailto:didymusibrahim@yahoo.com"><span style="font-family:&quot;Times New Roman&quot;,serif">didymusibrahim@yahoo.com</span></a><span style="font-family:&quot;Times New Roman&quot;,serif">.</span></p>\r\n\r\n<p class="MsoNormal"><span style="font-family:&quot;Times New Roman&quot;,serif">Thank you\r\nfor your time. </span></p>\r\n\r\n<p class="MsoNormal"><span style="font-family:&quot;Times New Roman&quot;,serif">Yours\r\nsincerely,</span></p>\r\n\r\n<p class="MsoNormal"><span style="font-family:&quot;Times New Roman&quot;,serif">Didymus\r\nIbrahim.</span></p>\r\n\r\n<p class="MsoClosingCxSpFirst"><span style="font-family:&quot;Times New Roman&quot;,serif">&nbsp;</span></p>\r\n\r\n<p class="MsoClosingCxSpLast"><span style="font-family:&quot;Times New Roman&quot;,serif">&nbsp;</span></p>\r\n\r\n<p class="MsoSignature"><span style="font-family:&quot;Times New Roman&quot;,serif">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal">&nbsp;</p>\r\n\r\n<!--[if gte 